import Tmdb from './Tmdb'

export default () => {

  // useEffect quando a tela for carregada vai carregar o que tiver dentro da função
  //useState salvar a lista

  const [movieList, setMovieList] = useState([])
  useEffect(() => {
    const loadAll = async () => {//funcao carregar tudo
      //pegando lista total
      let list = await Tmdb.getHomeList()//
      setMovieList(list)
      console.log(list);
    }
    loadAll()
  }, [])

  return (
    <div className='page'>
      Header
      Destaque
      listas diversas
    </div>
  );
}
